    value: 'Amended report to update the correct beginning and ending balance of the
      escrow account mentioned in the memo below. The transfer reflected on Sch H3
      on 1/13/14 reflects the nonfederal expenses that were paid for and reported
      on Sch H4 for 12/1/13 - 12/31/13. No expenditure, other than a direct contribution
      or exempt activity so identified, was made on behalf of a specifically identified
      federal candidate. No expenditure not identified and reported as such was for
      a public communication that referred to a clearly identified candidate for Federal
      office and that promoted, supported, attacked or opposed any such candidate
      for Federal office. All expenditures to individuals for rent that do not have
      a subsequent memo of itemization, represent rent income to those individuals
      and are not required to be itemized. No employee of the Committee spent more
      than 25% of compensated time during the month, within the reporting period,
      engaged in Federal Election Activity. Payments for salaries and related fringe
      benefits disclosed on Schedule H4 are for employees who spent less than 25%
      of their time engaged in activities in connection to any federal election. The
      Committee uses the Escrow option for receipt of corporate in-kind donations
      as provided for by the Commission in Advisory Opinion 1992-33. The method ensures
      that prohibited sources are not used to fund the federal share of allocable
      activity expenses. In-kind details and the escrow account activity are summarized
      as follows:   REVISED COMBINED ESCROW BALANCE OF $13,338.80 as of 12/31/13.   1/9/14
      Transfer to Admin escrow acct of $5,000 as reflected on Sch H4.  1/15/14 Sembler
